import React, { useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar";
import Footer from "../components/Footer";
import Particles from "react-tsparticles";
import { loadFull } from "tsparticles";

const Signup = ({ mode, setMode }) => {
    const [name, setName] = useState("");
    const [email, setEmail] = useState("");
    const [password, setPassword] = useState("");
    const [otp, setOtp] = useState("");
    const [otpSent, setOtpSent] = useState(false);
    const [otpVerified, setOtpVerified] = useState(false);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState("");
    const [successMessage, setSuccessMessage] = useState("");
    const navigate = useNavigate();

    const sendOtp = async () => {
        // Your OTP logic here...
    };

    const verifyOtp = async () => {
        // Your OTP verification logic here...
    };

    const handleSignup = async () => {
        // Your signup logic here...
    };

    const particlesInit = async (main) => {
        // Initialize the particles library
        await loadFull(main);
    };

    return (
        <div className="relative">
            {/* Hyperspeed background */}
            <Particles
                id="tsparticles"
                init={particlesInit}
                options={{
                    fullScreen: { enable: true },
                    background: { color: { value: "#000" } },
                    fpsLimit: 60,
                    interactivity: {
                        detectsOn: "canvas",
                        events: {
                            resize: true,
                        },
                    },
                    particles: {
                        number: { value: 200 },
                        color: { value: "#ffffff" },
                        shape: { type: "circle" },
                        opacity: {
                            value: 0.7,
                            random: true,
                        },
                        size: {
                            value: { min: 1, max: 3 },
                            random: true,
                        },
                        move: {
                            enable: true,
                            speed: 20,
                            direction: "bottom",
                            outModes: {
                                default: "out",
                            },
                        },
                    },
                }}
            />
            {/* Signup form */}
            <Navbar />
            <div className="flex flex-col items-center justify-center min-h-screen">
                <div className="bg-white p-6 rounded-md shadow-md w-full max-w-md z-10 relative">
                    <h2 className="text-2xl font-bold mb-4 text-center">Signup</h2>
                    {error && <p className="text-red-500 text-sm mb-4">{error}</p>}
                    {successMessage && <p className="text-green-500 text-sm mb-4">{successMessage}</p>}

                    <div className="mb-4">
                        <label className="block text-sm font-medium text-gray-700">Name</label>
                        <input
                            type="text"
                            value={name}
                            onChange={(e) => setName(e.target.value)}
                            className="w-full p-2 border border-gray-300 rounded-md"
                            disabled={otpSent}
                            required
                        />
                    </div>

                    <div className="mb-4">
                        <label className="block text-sm font-medium text-gray-700">Email</label>
                        <input
                            type="email"
                            value={email}
                            onChange={(e) => setEmail(e.target.value)}
                            className="w-full p-2 border border-gray-300 rounded-md"
                            disabled={otpSent}
                            required
                        />
                    </div>

                    {otpSent && !otpVerified && (
                        <div className="mt-4">
                            <label className="block text-sm font-medium text-gray-700">Enter OTP</label>
                            <input
                                type="text"
                                value={otp}
                                onChange={(e) => setOtp(e.target.value)}
                                className="w-full p-2 border border-gray-300 rounded-md"
                                maxLength={6}
                                required
                            />
                            <button
                                onClick={verifyOtp}
                                className="w-full mt-4 bg-green-500 text-white p-2 rounded-md hover:bg-green-600"
                                disabled={loading}
                            >
                                {loading ? "Verifying OTP..." : "Verify OTP"}
                            </button>
                        </div>
                    )}

                    {otpVerified && (
                        <button
                            onClick={handleSignup}
                            className="w-full mt-4 bg-blue-500 text-white p-2 rounded-md hover:bg-blue-600"
                            disabled={loading}
                        >
                            {loading ? "Signing Up..." : "Sign Up"}
                        </button>
                    )}
                </div>
            </div>
            <Footer />
        </div>
    );
};

export default Signup;
